const { Counter } = require('collections');
function f_gold(s) {
    const counter = new Counter(s);
    const cnt = Array(10).fill(0);
    cnt[0] = counter.get('z');
    cnt[2] = counter.get('w');
    cnt[4] = counter.get('u');
